import logo from './logo.svg';
import { PersonsComponent } from './components/Persons';
import React, { useState } from 'react';

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Cette application cherche des personnes
      </header>
        <input className='input' 
         type="text"
        id="page"
        name="page"
        onChange={handleChange} placeholder='Indiquer le numéro de la page que vous cherchez'></input>
      <table>
        <thead>
          <tr className='headers'>
            <td className="indiv-header">Prénom</td>
            <td className="indiv-header">Nom</td>
            <td className="indiv-header">Date de naissance</td>
            <td className="indiv-header">Sexe</td>
          </tr>
        </thead>
        <tbody>
          <PersonsComponent prop={page}></PersonsComponent>
        </tbody>
      </table>
    </div>
  );
}

export default App;
